Config = {}

--// 1. Main Config
-----------------------------------------------------------------------------------------------------------
Config.fxAntiResourceStop = true -- It will drop player that want to stop any of your scripts. If true dont start/stop/restart any scripts.
Config.fxResourceCounter = true -- Counting all resources. Ban player when there is something new. Dont add scripts and start if its true
Config.fxStringLengthMethod = true -- Checking for random strings when player injecting something
Config.fxWebHook = "xd" -- Put your discord webhook here.
----------------------------------------------------------------------------------------------------------
--// 2. Utils Config
----------------------------------------------------------------------------------------------------------

Config.fxMaxPlayerHealth = 200 -- Set here max health [Recommended 200 - its default max]

Config.fxMaxPlayerArmor = 100  -- Set here max player armor [default is 100 but recommend to change your max armor in scripts to 99 and set it to 99. its banning players that have more then ammout that you set]

Config.fxAntiDmgBoost = true -- If someone will try to use dmg boost > 5.0 he will get automatically banned. // May have some problems due to onesync

Config.fxAntiThermalVision = true -- If you have scripts that using thermal vision set it to false. Banning all players that trying to see in night

Config.fxAntiInvisible = true  -- Recommended to turn it on. Checking for player invissible and banning player. After latest update it shouldn't ban players that looking for cars in dealership

Config.fxAntiSpeedHack = true -- Anti Speed Hack. Recommend to turn it true

Config.fxEnablePlayerblipsCheck = true -- Enable players blips check / If you using scripts that have blips on players you should off it.

Config.fxAntiNightVision = true -- Its work exactly like anti thermal vision. Banning player that forcing night vision.

Config.fxExplosionProtection = true -- Protects player's from getting explosion damage.

Config.AntiGod = true

Config.fxAntiGodMode = true -- Simple anti god mode that works with 0x239528EACDC3E7DEnative. 

Config.fxPlayerProtection = true -- Protects players from explosive ammo / weapons. 

Config.fxAntiSpectate = true -- If you dont want modders to spectate your players set it to true. Works with fxac permission. 

